import Page from '../components/page';
import Footer from '../components/footer';

export default () => {
  const isAmp = useAmp();

  return (
    <Page title="Next.js by ZEIT - The React Framework">
      <Footer />
    </Page>
  );
};

export const config = {
  amp: true
};
